import React from 'react';

import DataContext from './../dataContext';

class demo extends React.Component{

    static contextType = DataContext;
    componentDidMount(){
        console.log(this.context,"context")
    }


    render(){
        return (
            <DataConsumer>
                {
                    (name)=>{
                       return <h1>Hello{name}</h1>
                    }
                }

            </DataConsumer>

        )
    }
}

export default demo;
